pragma solidity >=0.5.0 <0.7.0;

import "./SafeMath.sol";
import "./Doctor.sol";

contract PatientInfo is Doctor {

    //using SafeMath for uint256;
    using SafeMath32 for uint32;
    using SafeMath16 for uint16;

    uint32 counterPatient = 0;

    struct Patient {
        uint32 patientId;
        string lastName;
        string firstName;
        string gender;
        string addressOfPatient;
    }

    Patient[] public patients;

    event NewPatient(uint32 patientId, string firstName, string lastName);

    mapping (uint32 => address) patientCreatedBy;
    
    //mapping (address => uint) patientExaminations;

    function _createPatient(string memory _lastName, string memory _firstName, string memory _gender, string memory _addressOfPatient) private {
        counterPatient = counterPatient.add(1);
        uint32 idPatient = counterPatient.sub(1);
        patients.push(Patient(idPatient, _lastName, _firstName, _gender, _addressOfPatient));
        patientCreatedBy[idPatient] = msg.sender;
        ownerPatientCount[msg.sender] = ownerPatientCount[msg.sender].add(1);
        emit NewPatient(idPatient, _firstName, _lastName);
    }

    function addPatient(string memory _lastName, 
                        string memory _firstName, 
                        string memory _gender, 
                        string memory _addressOfPatient) public isDoctor(msg.sender) {
        _createPatient(_lastName, _firstName, _gender, _addressOfPatient);
    }
    
}
